import React, { useState } from "react";
import SResult from "./SResult";

const Search = () =>{

    const [img, setImg] = useState("");
    const InputEvent = (event) =>{
    const data = event.target.value;
    setImg(data);
    
    }
    

    return(
        <>
        <h1>Search Page </h1>
        <input
            type="text"
            placeholder="Enter Some Text"
            onChange={InputEvent}
            value={img}
        />
        <SResult/>
        </>
    );
}
export default Search;
